import React, { useEffect, useState } from 'react'
import { Routes, Route, Link } from 'react-router-dom'

const Produto = () => {
  const [data, setData] = useState()

  useEffect(() => {
    const request = fetch('https://ranekapi.origamid.dev/json/api/produto')
      .then((res) => res.json())
      .then((json) => setData(json))
  }, [])

  console.log(data)

  return (
    <div>
      <nav>
        <Link to=''>Descrição</Link>
        <Link to='avaliacao'>Avaliação</Link>
        <Link to='customizado'>Customizado</Link>
      </nav>
      <Routes>{/* <Route path="" element={<ProdutoDescricao />} /> */}</Routes>
    </div>
  )
}

export default Produto
